  false,\n\t\"url\": null,\n\t\"notes\": \"This report displays the FY2012 renewal
  and new homeless assistance projects awarded by HUD for the FY2012 Continuum of
  Care (CoC) Program competition. Approximately $1.61 billion was awarded for renewal
  grants (March and May 2013), and on July 31 HUD announced an additional $57.4 million
  in new awards that include those projects that were reallocated from existing projects.
  The CoC Program provides funding for transitional and permanent housing and supportive
  services. These reports are organized by state and then by CoC, or community. Within
  each listed CoC are the organizations that will be assisted with these awards.\",\n\t\"license_title\":
